import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import theme from './theme';
import { AuthProvider } from './contexts/AuthContext';
import { NotificationProvider } from './contexts/NotificationContext';
import { TicketProvider } from './contexts/TicketContext';

// Auth Components
import Login from './pages/auth/Login';
import StaffLogin from './pages/auth/StaffLogin';
import Register from './pages/auth/Register';
import LoginBypass from './pages/auth/LoginBypass';

// Layout Components
import Layout from './components/layout/Layout';

// Protected Route Component
import PrivateRoute from './components/auth/PrivateRoute';

// Dashboard Components
import ClientDashboard from './pages/dashboard/ClientDashboard';
import TechnicianDashboard from './pages/dashboard/TechnicianDashboard';
import AdminDashboard from './pages/dashboard/AdminDashboard';

// Ticket Components
import CreateTicket from './pages/tickets/CreateTicket';
import TicketList from './components/tickets/TicketList';
import TicketDetails from './pages/tickets/TicketDetails';

// Admin Components
import UserManagement from './pages/admin/UserManagement';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AuthProvider>
        <NotificationProvider>
          <TicketProvider>
            <Router>
              <Routes>
                {/* Public Routes */}
                <Route path="/" element={<Navigate to="/auth/login" />} />

                {/* Authentication Routes */}
                <Route path="/auth/login" element={<Login />} />
                <Route path="/auth/staff-login" element={<StaffLogin />} />
                <Route path="/auth/register" element={<Register />} />
                <Route path="/auth/login-bypass" element={<LoginBypass />} />

                {/* Protected Client Routes */}
                <Route element={<PrivateRoute allowedRoles={['client']} />}>
                  <Route element={<Layout />}>
                    <Route path="/client" element={<ClientDashboard />} />
                    <Route path="/client/tickets/create" element={<CreateTicket />} />
                    <Route path="/client/tickets" element={<TicketList />} />
                    <Route path="/client/tickets/:id" element={<TicketDetails />} />
                  </Route>
                </Route>

                {/* Protected Technician Routes */}
                <Route element={<PrivateRoute allowedRoles={['technical']} />}>
                  <Route element={<Layout />}>
                    <Route path="/technical" element={<TechnicianDashboard />} />
                    <Route path="/technical/tickets" element={<TicketList />} />
                    <Route path="/technical/tickets/:id" element={<TicketDetails />} />
                  </Route>
                </Route>

                {/* Protected Admin Routes */}
                <Route element={<PrivateRoute allowedRoles={['admin']} />}>
                  <Route element={<Layout />}>
                    <Route path="/admin" element={<AdminDashboard />} />
                    <Route path="/admin/users" element={<UserManagement />} />
                    <Route path="/admin/tickets" element={<TicketList />} />
                    <Route path="/admin/tickets/:id" element={<TicketDetails />} />
                  </Route>
                </Route>

                {/* Fallback routes */}
                <Route path="*" element={<Navigate to="/auth/login" />} />
              </Routes>
            </Router>
          </TicketProvider>
        </NotificationProvider>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
